import logo from './logo.svg';
import './App.css';
import BannerImage from './components/BannerImage';
import Header from './components/Header';
import MenuBar from './components/MenuBar';

function App() {
  return (
    <div className="App">
	  <MenuBar/>
	  <header className="App-header">
	  <BannerImage/>
	  </header>
    </div>
  );
}

export default App;
